import React from 'react';
import TextField from '@material-ui/core/TextField';
import { Tab, Tabs, Box, Button } from '@mui/material';
import useCustomForm from '../../hook/useForm/useCustomForm';
import { useNavigate } from 'react-router-dom';

import "./Contato.css"
import ErrorMessage from '../../hook/useForm/useCustomForm';


export default function Contato() {
  const { register, handleSubmit, errors } = useCustomForm();
  const [value, setValue] = React.useState(0);
  const navigate = useNavigate();  // Use useNavigate em vez de useHistory

  const handleChange = (event: React.ChangeEvent<{}>, newValue: number) => {
    setValue(newValue);
  };

  const onSubmitForm = (data: any) => {
    console.log(data);

    // Inspect each property of the data object
    Object.entries(data).forEach(([key, value]) => {
      console.log(`${key}:`, value);
    });

    // Redireciona para a página principal
    navigate('/');  // Use navigate para redirecionar para a página desejada
  };

  return (
    <div className='container-form'>
      <div className='title-subtitle'>
        <h1 /* className='title-customer' */>CENTRAL DE ATENDIMENTO</h1>
        {/* <h4>Envie uma mensagem</h4> */}
      </div>


      <form onSubmit={handleSubmit(onSubmitForm)}>

        <Box className='container-box-primary'>
          <Tabs
            className='container-tabs'
            orientation='vertical'
            variant="scrollable"
            value={value}
            onChange={handleChange}
            aria-label="Vertical tabs example"
          >
            <Tab label="Envie uma mensagem" />
          </Tabs>

          {value === 0 && (
            <Box p={3} className='container-dados'>
              <div className='text' >
                <TextField fullWidth label="Nome" {...register('name', { required: 'Campo obrigatório' })} />
                {errors.name && <p>{errors.name.message}</p>}

                <TextField fullWidth label="Email" {...register('email', { required: 'Campo obrigatório' })} />
                {errors.email && <p>{errors.email.message}</p>}

                <TextField fullWidth label="DDD + Telefone ou Celular" {...register('phone', { required: 'Campo obrigatório' })} />
                {errors.phone && <p>{errors.phone.message}</p>}

     <TextField fullWidth label="Mensagem" multiline rows={4} {...register('message', { required: 'Campo obrigatório para a mensagem' })} />
     {errors.phone && <p>{errors.phone.message}</p>}

              </div>
            </Box>
          )}
        </Box>

        <div className='button'>
          <Button className='button-form-dados' type="submit" variant="contained" color="primary">
            Enviar Mensagem
          </Button>
        </div>
      </form>
    </div>
  );
}
